<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8" />
    <title>Simple PDF Generator</title>
    <style>
        body {
            font-family: system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
            padding: 2rem;
            background: #f5f5f5;
        }

        .container {
            max-width: 480px;
            margin: 0 auto;
            background: #ffffff;
            padding: 1.5rem 2rem;
            border-radius: 8px;
            box-shadow: 0 2px 8px rgba(0,0,0,0.08);
        }

        label {
            display: block;
            margin-top: 1rem;
            margin-bottom: 0.25rem;
            font-weight: 600;
        }

        input {
            width: 100%;
            padding: 0.5rem 0.75rem;
            border-radius: 4px;
            border: 1px solid #ccc;
            font-size: 1rem;
            box-sizing: border-box;
        }

        button {
            margin-top: 1.5rem;
            padding: 0.6rem 1.25rem;
            font-size: 1rem;
            border-radius: 4px;
            border: none;
            cursor: pointer;
            background: #2563eb;
            color: #ffffff;
            font-weight: 600;
        }

            button:hover {
                filter: brightness(1.05);
            }
    </style>
</head>

    function savePDF(name, title) {


        var name = arguments[0];
        var title = arguments[1];
        var saveCert = "download"


        // Get todays date in format dd/mm/yyyy
        var today = new Date();
        var monthNames = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];

        var d = new Date()
        var dd = today.getDate();
        var mm = today.getMonth() + 1; //January is 0!

        var month = new Array();
        month[0] = "January";
        month[1] = "February";
        month[2] = "March";
        month[3] = "April";
        month[4] = "May";
        month[5] = "June";
        month[6] = "July";

        var n = month[d.getMonth()];

        if (dd < 10) {
            dd = '0' + dd
        }
        if (mm < 10) {
            mm = '0' + mm
        }
        date = n + ' ' + dd + ', ' + yyyy;
